import React from 'react';

function SavedNewsInfo(params) {
  return (
    <div className='saved-news-info'>
      <p className='saved-news-info__subtitle'></p>
      <h2 className='saved-news-info__title'></h2>
      <p className='saved-news-info__keywords-info'><span className='saved-news-info__keywords'></span></p>
    </div>
  )
}
